import React from "react";

const Tip = ({ tipcars }) => {
  if (!Array.isArray(tipcars) || tipcars.length === 0) {
    return <div>No tips available</div>;
  }

  return (
    <div>
      {tipcars.map((tip, index) => (
        <p key={index}>{tip.nametip}</p>
      ))}
    </div>
  );
};

export default Tip;
